import React, { Fragment } from "react";

// import components
import ChannelHeader from "../channelHeader";

// import styles
import s from "../../styles/speakers.module.css";

const Speaker = () => {
  return (
    <Fragment>
      <ChannelHeader />
      <div className={s.SpeakerContainer}>
        <div className={s.title}>
          <p>They will teach you</p>
          <h1>Meet The Speakers</h1>
        </div>
        <div className={s.speaker}>
          <img
            src="../../static/assets/images/speaker.jpg"
            alt="speaker"
            className="img-fluid"
          />
          <p>Jerome Ternynck</p>
          <span>Javascript Expert</span>
        </div>
      </div>
    </Fragment>
  );
};

export default Speaker;
